import React, { Component } from 'react'


export default class Navbar extends Component {
    render() {
        return (
               <nav className="navbar navbar-dark bg-dark">
                  <h1 className="text-title mx-auto col-sm-10 ">
                   <div className="logo">
                        <i className="fa fa-pencil-square-o"/>
                   </div>
                   <span className="px-4">
                      noteworx
                   </span>   
                  </h1>
               </nav>

        )
    }
}
